description:
Deputy Marshall Raylan Givens (Olyphant) is exiled to his hometown of Harlan County, Kentucky after the shooting of a Miami drug cartel hit man raises debate over his renegade style of law enforcement. Unfortunately it isn't long before the people he left behind begin to surface in the most unexpected ways. Raylan's new job pursuing prison escapees, fugitive con men and a corrupt local sheriff has never been more intense.

